"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAURELIO MELO\n</p>\n<p>\nBOSTON -- Aurelio Melo, 56, of North Dartmouth died Monday, Jan. 12, 2004, at Beth Israel/Deaconess Hospital after a long illness. He was the husband of Silvana (Reis) Melo.\n</p>\n<p>\nBorn in Sao Miguel, Azores, the son of Maria (dosAnjos) deMelo of South Dartmouth and the late Joao Inacio deMelo, he lived in this area since 1971.\n</p>\n<p>\nMr. Melo formerly was a laborer at J.I. Paulding Co. He was a communicant of St. Julie Billiart Church, Dartmouth.\n</p>\n<p>\nHe served in the Portuguese army in the war in Guinea.\n</p>\n<p>\nSurvivors include his widow; his mother; two sons, Jamie Melo and his wife, Maria, and Scott Melo and his wife, Patricia, all of Dartmouth; a daughter, Diane Melo Augusto, and her husband, Durval, of Dartmouth; three grandsons, Scott Melo Jr., Logen Augusto and Joshua Melo; a brother, Raimundo Melo of Sao Paulo, Brazil; three sisters, Lucilia M. Costa and Maria Natividade Tavares, both of Dartmouth, and Maria F. Alves of New Bedford; and several nieces and nephews.\n</p>\n<p>\nHis funeral Mass will be at 10 a.m. Thursday at St. Julie Billiart Church. Burial will be in St. John's Cemetery, New Bedford.\n</p>\n<p>\nArrangements are by Perry Funeral Home, 111 Dartmouth St., New Bedford.\n</p>\n</div>\n</div>",
