"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMariana (Melo) Campos, 98, formerly of Jencks St., passed away on Tuesday, September 15th after a long illness. Widow of Dimas P. Campos. Born in Bretanha, St. Michael, Azores, daughter of the late Joao I. and Maria Rosa (Pavao) Melo. A retired textile worker, she immigrated to this city in 1967. Mother of Humberto, Henrigue (wife-Nomesia) and Dinis Campos all of Fall River, and the late Horace Campos (his wife- Joanne of Swansea). She also leaves 10 grandchildren; 11 great grandchildren; many nieces and nephews. Her funeral Mass was offered on Saturday September 19th at Espirito Santo. Pallbearers Dennis Campos, Corey Campos, Fernando Campos, Kevin Campos, Lenny Campos, and Austin Campos brought Mariana to her final resting place in Notre Dame Mausoleum. Donations may be made to Hospice, 502 Bedford Street, Fall River, MA 02720\n</p>\n</div>\n</div>",
