"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nO meu av\u00f4 Francisco Cordeiro de Miranda, juntamente com seus irm\u00e3os, nasceram nessa casa. Meu av\u00f4 nasceu em 28 de fevereiro de 1858. No final do s\u00e9culo XIX, emigrou para o Brasil com sua esposa Maria Eugenia de Carvalho, filhos e o irm\u00e3o Manoel Cordeiro de Miranda.Depois vieram mais dois irm\u00e3os, Luis Cordeiro de Miranda e Jo\u00e3o Cordeiro de Miranda. O irm\u00e3o Ver\u00edssimo ficou nos A\u00e7ores e outro irm\u00e3o Agostinho foi para os Estados Unidos. Os pais deles, meus bisav\u00f3s, eram; Mariana da Concei\u00e7\u00e3o Fernandes Cordeiro e Jos\u00e9 Cordeiro de Miranda. Ambos faleceram em 1920. Francisco, meu av\u00f4, se estabeleceu em Maranguape,Cear\u00e1, Brasil, onde deixou uma descend\u00eancia biblicamente numerosa.\n</p>\n</div>\n</div>",
