"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNotas Gerais: Antonio Jos\u00e9 Lopes da Luz, vig\u00e1rio da Candel\u00e1ria escreveu  um artigo em 1903 sobre o legado de Pero Moreyra. Ele observou que, de todos os aristocratas fundi\u00e1rios da pequena aldeia apenas Pero Calvo viveu em suas explora\u00e7\u00f5es. Al\u00e9m disso, como tesoureiro da par\u00f3quia tamb\u00e9m,exercia fun\u00e7\u00f5es de not\u00e1rio. Ele e seus descendentes s\u00e3o conhecidos como sendo alguns dos poucos membros da par\u00f3quia que eram alfabetizados. A par\u00f3quia na \u00e9poca tinha apenas 98 casas e 441 habitantes. Ele \u00e9 creditado como sendo o progenitor das fam\u00edlias Ara\u00fajo, Raposo e Amaral. Tinha 10 gera\u00e7\u00f5es de descendentes que incluia 125 grupos familiares  com mais de 200 netos  no momento da reda\u00e7\u00e3o do artigo 1903.  O artigo  menciona que Jo\u00e3o de Ara\u00fajo, foi muito respeitado que servia  como sacrist\u00e3o na \u00e9poca e, como os seus antepassados ??era uma das poucas pessoas alfabetizadas na aldeia.\n</p>\n<p>\nGeneral Notes: Antonio Jose Lopes da Luz, vicar of Candelaria wrote in an article in 1903 about the legacy of Pero Moreyra.  He noted that of all the landed gentry of the small village only Pero Calvo lived on his holdings. Moreover, as the treasurer of the parish he was the equivalent of local nobility.  He and his descendants are noted as being some of the few members of the parish who were literate.  The parish at that time had only 98 houses and 441 inhabitants.  He is credited with being the progenitor of the Ara\u00fajo, Raposo and Amaral families.   He descendants included 125 family groups and more than 200 tenth generation grandchildren at the time of the writing of the 1903 article.  Included in that article was mention of  the much respected Jo\u00e3o de Ara\u00fajo who was acting as sacristan at the time and like his forefathers was one of the few literate people in the village.\n</p>\n</div>\n</div>",
