"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nStacy Mota  and<br />\nJaime Mota\n</p>\n<p>\nOur Little Miracle Has Finally Arrived! Olivia Ana Mota (nee Barberic)\n</p>\n<p>\nStacy and Jaime thank God for the safe arrival of their first child, Olivia Ana, born June 1, 2011 at 1:45 p.m., weighing 7 lbs. 2 oz. Olivia is welcomed into the world by ecstatic baka Branka and deda Joe Barberic and av\u00f3 Marianne and av\u00f4 Tony Mota. Equally excited are teta Tanya and tece Eric, ujak Steven, ujna Lee-Ann and baby cousin Maksim, titia Julie, tio Mike and cousin Alice. Olivia is also welcomed by great-grandmothers Zora, Alice and Evangelina. Smiling from heaven are great-grandparents Ana and Janko Barberic, Frank Spahic, Jaime Carvalho and Antonio Mota. Special thanks to the fabulous L&amp;D staff at MUMC, especially nurse Betty-Ann Mammoletti for her superb coaching and care.\n</p>\n</div>\n</div>",
