"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJoao O. Novo, 79, of Fall River, husband of the late Maria Dos Anjos (Vitorino) Novo, died Friday, December 5, 2014. Born in Bretanha, St. Michael, Azores, he was employed in the seafood industry. A member of Kingdom Hall of Jehovah\u2019s Witnesses, he was a devoted husband, father and a hardworking family man. Survivors include 7 children, Fatima Paiva (husband Ronald Jr.), Rose Novo, Bernadette Melo, John Novo (wife Maria), Robert Novo (wife Lucieo) Diane Viveiros (husband Michael), and Timothy Novo (Vera Fonseca); grandchildren, Aires, Gabriel, Crystal, Ronnie III, Justin, Jonathan, Michelle, Larissa, Katlyn, Nicole, Angely, Jacob, Kiane, Kalie and Angeleana, Jayden, Jason and Ayden; great-grandchildren Malaki, Travis, Aubrey, Jose and (Liliyen); siblings Jack, Manuel, Joe, Messias and Michael Novo, Lucy Oliveira, Rose Araujo, Fatima Ferreira and Teresa Pacheco, nieces and nephews. He was the son of the late Joao and Rosa Mateus de Oliveira Novo, stepson of the late Adelaide (Bernardo) Novo and the brother of the late Rose Simas.\n</p>\n<p>\nVisitation, Monday from 4:00 to 8:00 PM, with a service during the visitation at 7 P.M. in the AUCLAIR FUNERAL HOME, 690 So. Main St., Fall River. Please omit flowers. LARGE PARKING AREA and BARRIER-FREE ENTRANCE at the rear of funeral home. Cremation to follow.\n</p>\n</div>\n</div>",
