"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJose O. Novo, 92, of Fall River, passed away on March 14, 2009 after a brief illness at Charlton Memorial Hospital. He was the husband of Emilia (Pereira Braz) Novo, with whom he shared 70 years of marriage. Born in Remedios, Bretanha, St. Michael, Azores, he was a son of the late Francisco &amp; Mariana (Teves) Oliveira Novo. A Fall River resident since 1952, he worked in construction and belonged to the Laborer's Union, Local #271. He loved the ocean and enjoyed fishing. Survivors include sons, Frank Novo (wife - Mary) of Somerset and Joseph Novo (wife - Mary Helen) of Westport; son-in-law, Robert A. Marshall of Fall River; a daughter, Alice Canito (husband - Robert) of Fall River; brothers, Messias Novo, Antone Novo and Armando Novo, all of Toronto, Canada; sisters, Maria Teves and Norbena Medeiros, both of Toronto, Canada; 14 grandchildren, 8 great grandchildren and several nieces and nephews. He was also father of the late John O. Novo and Mary Marshall, and was brother of the late Mariana Medeiros, Francisco Novo, Manuel Novo and Antone Novo. His funeral Mass was celebrated in St. Anthony of Padua Church. His committal service was held at St. Patrick Cemetery.\n</p>\n</div>\n</div>",
