"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMrs. Paulina Darosa age 67 years of Regina Avenue passed away on Tuesday October 1, 2002. Born in Sao Miguel Azores, Portugal she came to Canada in 1965 and settled in Thunder Bay. Paulina enjoyed her family especially looking after her grandchildren and having her family over for Sunday dinners. Paulina was a member of St. Anthony's Roman Catholic Church and the C.W.L. Paulina was survived by her children Louis (Nicole), Mario (Rose), Jimmy (Wendy) and Paul (Kim). Grandchildren Kimberly, Darian, Bailey, Victoria and Kaden. Brothers and sisters: Maria (Louis) Raposo of Kitchener, Fernanda(Gilberto) Sousa of Kitchener, Adelina (Ilidio) daSilva of Thunder Bay, Ernesto (Maria) Novo of Thunder Bay, Belmira (Jose) Pacheco of Portugal, Antonia (Antonio) Arrvda of Kitchener, Balbina Simoes of Fall River and Manuel (Maria) Novo of Portugal. Many nieces, nephews and other relatives also survive. Paulina was predeceased by her husband Luis, and her parents Manuel and Maria Novo. Funeral services for the late Mrs. Paulina Darosa will be held on Friday October 4, 2002 leaving the EVEREST CHAPEL 299 Waverley Street at Algoma at 8:50 AM to St. Anthonys R. C. Church for The Funeral Mass at 9:30 AM. Interment to follow in St Andrews Cemetery. Visitation for family and friends will be on Thursday from 6:00 - 9:00 PM in the Everest Chapel with the Vigil Prayers at 7:00 PM. If friend so desire donations to the Northern Cancer Research Foundation or to Heart and Stroke Foundation would be greatly appreciated by the family.Please sign theonline condolences at everestofthunderbay.com\" - See more at: http://www.legacy.com/obituaries/chroniclejournal/obituary.aspx?n=paulina-darosa&amp;pid=173983188#sthash.r8sSE4he.dpuf\n</p>\n</div>\n</div>",
