"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJo\u00e3o Perdig\u00e3o, Casou a 1.\u00aa vez com Jordoa Manuel<br />\nteve da 1.\u00aa mulher:\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJo\u00e3o Gon\u00e7alves Perdig\u00e3o, escudeiro de Ponta Gar\u00e7a, fez testamento com a mulher aprovado a 16.27.1551; foi testamenteiro o genro Belchior Gon\u00e7alves. Ele e sua mulher fundaram a igreja das Furnas (uma ermida perto da igreja acutal do Sant'Ana, que depois foi reconstru\u00edda pelo licenciado Baltazar Brum da Silveira). Casou com Branca Gomes.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nN\u00e3o fez testamento e foi enterrado na ermida de St.\u00aa B\u00e1rbara.\n</p>\n</div>\n</div>",
