"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNa sua juventude foi pagem do Infante D.Pedro, pelo que, posteriormente, na corte de D.Afonso V,foi pouco favorecido; foi casar c/ uma sua prima de Castelo Branco, onde passou a viver.\n</p>\n<p>\nFP e GSM chama-o \"Camelo Pereira\".<br />\nDescendente de D.Afonso Henriques.\n</p>\n</div>\n</div>",
