"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nGil Caetano Pereira, 85, of Fall River, husband of Helena (Cordeiro) Pereira, passed away peacefully at St. Anne's Hospital on Saturday, November 18, 2017. Born in Bretanha, St.Michael, Azores, he was a son of the late Gil and Candida (Felipe) Pereira. He worked as a machine operator at Quaker Fabric for many years prior to his retirement. Gil enjoyed playing cards, family gatherings, tending to his grapevines, and making his own wine. He truly loved life in general. Most important to him was spending time with his loving family especially his adorable grandchildren. Besides his wife of sixty years, he leaves: his six children, Gilda Medeiros and her husband Jose, Luis Pereira and his wife Sandy, Gil Pereira and his wife Lee, Paul Pereira and his wife Darlene, Carlos Pereira and his wife Mariana, all of Fall River, and Gabriel Pereira and his wife Tina of Dartmouth; seven grandchildren, Monique Medeiros, Phillip Medeiros, Kyle Pereira, Eric Pereira, Jake Pereira, Ryan Pereira, and Briana Pereira; one great-grandson, Josiah Emerald; a sister, Lurdes Pereira of Fall River; and many nieces and nephews. He was also the brother of the late Jose C. Pereira and the late Manuel Pereira. His Funeral Mass was celebrated on Wednesday, November 22nd, in Esp\u00edrito Santo Church followed by his committal at Norte Dame Cemetery.\n</p>\n</div>\n</div>",
