"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\nMichele D. Phenix, R.N., 45, of Fall River, died Thursday, October 20, 2011, after a long illness. Michele started her nursing career at the age of 16, when she was a candy striper at Union Truesdale Hospital. Then she attended Diman Regional Medical Asst. Program, and graduated as a medical assistant in 1987. She worked as an E.K.G. technician at St. Anne\u2019s Hospital for many years.<br />\nMichele then attended B.C.C. Nursing Program and began to work toward her R.N. She graduated from the nursing program in 1995 with highest honors. She was passionate, loving, and extremely devoted to her practice. She dedicated her life to taking care of others. She also loved the beach and gardening.<br />\nSurvivors include her mother, Cynthia (Viveiros) Phenix of Fall River, a sister, Kathleen Dufault and her husband Allen of Braintree, aunts and uncles, Adilardo Viveiros, Antero Viveiros and his wife Robin, John Viveiros and his wife Valerie, Lisa Viveiros, Melissa Barboza and Michael Viveiros, longtime faithful and loyal friend, Noel Silvia, a faithful companion Be-Be Mae, and many cousins. She was the daughter of the late Paul Phenix.\n</p>\n</div>\n</div>",
