"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPassed away peacefully after a long illness on September 21, 2016 at the age of 72 years. Loving husband to Maria for 46 years. Dearest father to Lucia (Louis) Pedro, Nancy (Tony) Mendonca, Sandy Pimentel, Melanie Pimentel, and the late Joao Antonio(1973). Cherished Avo to John, Elizabeth, Samantha, Jake, Adrian, Taylor, Christian, Ashton, Adam and Xavier. Survived by his brothers, Jose and Manuel. Will be missed by many nieces, nephews and extended family members. Visitation will be held at WINDSOR CHAPEL (Central Chapel) 1700 Tecumseh Rd E, 519.253.7234 on Thursday, September 22, 2016 from 7-9pm. Parish prayers at 7:30pm. Visitation will continue at 10am on Friday, September 23, 2016 until time of Funeral Mass at 11am at Our Lady of Perpetual Help Church (804 Grand Marais Rd. East). Interment to follow at Heavenly Rest Cemetery. In kindness, donations may be made to the Renal Dialysis Clinic - Ouellette Campus. Online condolences and cherished memories may be made at www.windsorchapel.com.\n</p>\n</div>\n</div>",
