"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWas christened in living in Matriz de S\u00e3o Jorge, Nordeste, S\u00e3o Miguel, A\u00e7ores.<br />\nMorador no Nordeste, Cavaleiro de Santiago e 2.\u00ba Juiz dos \u00d3rf\u00e3os em Vila Franca, em 1533 (Frutuoso, Livro IV, Cap.\u00ba LXII). Consta do testamento de sua irm\u00e3 Susana Afonso. Assinou como testemunha, a 25.4.1529, a escritura de doa\u00e7\u00e3o de 31 alqueires de terra que Est\u00eav\u00e3o Cha\u00ednho e sua mulher Catarina Afonso doaram \u00e0 ermida do Ros\u00e1rio do Nordeste.<br />\nSalvador Afonso Pimentel, morador no Nordeste, Cavaleiro de Santiago e 2.\u00ba Juiz dos \u00d3rf\u00e3os em Vila Franca, em 1533 (Frutuoso, Livro IV, Cap.\u00ba LXII). Consta do testamento de sua irm\u00e3 Susana Afonso. Assinou como testemunha, a 25.4.1529, a escritura de doa\u00e7\u00e3o de 31 alqueires de terra que Est\u00eav\u00e3o Cha\u00ednho e sua mulher Catarina Afonso doaram \u00e0 ermida do Ros\u00e1rio do Nordeste.<br />\nAs filhas do Tenente Pedro Pimentel Resende habilitaram-se em 1721 ao legado do licenciado Ant\u00f3nio Pacheco Os\u00f3rio justificando a sua ascend\u00eancia paterna at\u00e9 seu quinto av\u00f4 Salvador Afonso Pimentel, que a justifica\u00e7\u00e3o diz ser irm\u00e3o de Susana Afonso, mulher de Mateus Vaz Pacheco, bisav\u00f4 do instituidor. Achada habilita\u00e7\u00e3o existe na Miseric\u00f3rdia de Ponta Delgada.George Pacheco has death certificate and believes to be his.<br />\nHe is burried in the grave of Jo\u00e3o Ribeiro\n</p>\n</div>\n</div>",
