"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nCREMILDE PAVAO<br />\nObituary<br />\nGuest Book<br />\n1 entry\n</p>\n<p>\nThe Guest Book is expired.<br />\nRestore the Guest Book\n</p>\n<p>\nPAVAO, Cremilde (Raposo)<br />\n80 years, with great faith and strength embraced eternal peace. Beloved wife of the late 'son of a gun' Joaquim Pavao (1996). Cherished mother of John and Rina Pavao, the late Maria (2010) and Brian Chambers, Alfie Pavao, Jack and Dee Pavao, Mary Jo and the late Eugene Tarnovietchi (2004) and Emily and John Murracas. Treasured grandmother of Kristin, Jennifer, Ashley, Stephanie, Vanessa, Jaclyn, Lindsey, Kiera and Kylie. Avo to sole great-grandson Quinn, who was responsible for bringing her many wonderful smiles, even in her last moments. She anxiously awaited the arrival of her precious great(twin)-granddaughters. Her family is comforted knowing she is reunited with those she loved and will bring many blessings from above. Loyal sister of Evaristo Raposo, Leontina Tavares, the late Serafin Raposo (2006) and Maria Jose Tavares. She will be missed by her many devoted friends from both the church and community. She will be most remembered for her strong faith and her love and commitment to her companion and son, Alfie which was endless. Visiting at the<br />\nReid Funeral Home &amp; Reception Centre,<br />\n14 Russell Street, Leamington<br />\n(519-326-2631)<br />\non Monday from 2-5 and 7-9 p.m. Funeral Mass to celebrate Cremilde's life will be held at St. Michael's Church, Leamington on Tuesday, April 22, 2014 at 10 a.m. Fr. Patrick Beneteau officiating. Interment at Evergreen Memorial Park Cemetery to follow. Parish Prayers Monday evening. In her gracious honour, donations in trust to Alfie will be accepted. Please make cheques payable to Alfie Pavao. Family and friends are invited to share their words of comfort and remembrance at<br />\n- See more at: http://www.legacy.com/obituaries/windsorstar/obituary.aspx?pid=170711505#sthash.tSz0R7nH.dpuf\n</p>\n</div>\n</div>",
