"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nManuel Raposo, das Feteiras, que juntamente com a mulher fez uma escritura de dote a sua filha Apol\u00f3nia a 4.12.1630, nas notas de Jorge Palha de Macedo em Ponta Delgada (Nota N.\u00d9B 1). Casou antes de 1601 com Ana Gon\u00e7alves.<br />\nA 12.1.1601 em Ponta Delgada, Manuel Raposo, morador nas Feteiras e sua mulher Ana Gon\u00e7alves vendem um foro nas notas do tabeli\u00e3o Francisco Serr\u00e3o, Livro de 1601 a 1603. Este Manuel Raposo deve ser o pai de Agostinho Raposo, casado com Isabel de Vasconcelos e, portanto pai tamb\u00e9m de Paulo Raposo, morador nas Feteiras a quem se refere uma escritura de 21.5.1677 em Ponta Delgada no livro de notas de 1671 a 1677 do tabeli\u00e3o Gon\u00e7alo Pacheco de Medeiros, que diz o seguinte: Manuel de Miranda e sua mulher Fel\u00edcia Raposo, Domingos da Cunha e sua mulher Maria Sim\u00f5es e Ant\u00f3nio de Miranda e sua mulher Maria Sim\u00f5es, lavradores e moradores na Relva, vendem uma casal e terras que foram do capit\u00e3o Agostinho Raposo, falecido e que por sua morte passaram para seu irm\u00e3o Paulo Raposo, falecido, sogro e pai dos vendedores, morador que foi nas Feteiras de quem os vendedores o herdaram por folhas de partilha de ............... 1 - 1677 .\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nIndividual, family: John Raposo\n</p>\n</div>\n</div>",
