"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMr. Henrique \"Henry\u201d DaRosa age 62 years of Community Hall Road passed away unexpectedly on Thursday October 31, 2002. Born in Sao Miguel Azores, Portugal on September 1, 1940, Henry came to Thunder Bay in 1960 where he began working for various companies like Hacquoil, Sillman Construction, Bannister Pipelines, and then in 1979, he began to work for Bruno\u2019s Contracting where he remained for the last 23 years. While here in Thunder Bay Henry married his wife Maria on December 31, 1968 and they enjoyed 35 happy years together. He lived for his family and his grandchildren, they were the most important things to him. His garden and his animals were his favorite pastime, especially his two dogs Ocean and Mercedes. He was a longtime member of both St. Anthony\u2019s Roman Catholic Church and the Portugese Association of Thunder Bay. Henery will be sadly missed by his loving wife Maria, his children Elizabeth Pavao, Nancy (Tom) Giesen, Rosemarie (Kevin) Long, grandchildren Stephanie, Christopher, Jessica, Kodie, and Karlie, brother Joe DaRosa, sisters Maria Costa, Odelia Machado, and Olivia (Joe) Reis of Portugal. Mother-in- Law Maria Graca, numerous nieces, nephews and other relatives also survive.<br />\nHenry was predeceased by his parents, brothers Luis and Manuel, brothers-in-law Jamie Costa and Joe Machado, sisters-in-law Gilda DaRosa and Pauline DaRosa and his father-in-law John Graca.<br />\nFuneral Services will be held on Tuesday November 5, 2002 leaving the EVEREST FUNERAL CHAPEL, 299 Waverley St. at Algoma, at 8:50 AM for Funeral Mass at 9:30 AM in St. Anthony\u2019s Roman Catholic Church. Visitation for friends will be held on Monday November 4, 2002 from 5:00 PM to 9:00 PM with Prayers being offered at 7:00 PM in the Everest Chapel. If friends so desire donations may be made to the Juvenile Diabetes Association or to the Allergy and Asthma Information Association.\n</p>\n</div>\n</div>",
