"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nD\u00e9c\u00e9d\u00e9e le 22 janvier 2017 \u00e0 l'\u00e2ge de 84 ans. Elle \u00e9tait la fille de feu Th\u00e9ophile Saucier et de feu Alma S\u00e9guin ainsi que l'\u00e9pouse de feu Cl\u00e9ment Labrecque. Anna fut pr\u00e9d\u00e9c\u00e9d\u00e9e par son fils Cl\u00e9ment Jr. Elle laisse dans le deuil ses enfants Fran\u00e7oise, Anne (Richard Paquin), Joanne (Antonio Raposo) et Lise; ses petits-enfants Jos\u00e9e, Roland, Eric, Patrick, Julie, Genevi\u00e8ve, V\u00e9ronique, Bruce et Pascale ainsi que ses arri\u00e8re-petits-enfants Claudia, Halle, Rowan, Tara, Thomas, Noah, No\u00e9mie et Chlo\u00e9. Elle laisse \u00e9galement sa s\u0153ur Irma Beauchamp ainsi que plusieurs neveux, ni\u00e8ces et amis. Anne fut pr\u00e9d\u00e9c\u00e9d\u00e9e par son fils Cl\u00e9ment Jr, ses 6 s\u0153urs et ses 5 fr\u00e8res. Il y aura des visites le lundi 6 f\u00e9vrier 2017 de 14h \u00e0 16h et de 18h \u00e0 20h \u00e0 la Maison Fun\u00e9raire Racine, Robert &amp; Gauthier (180 chemin Montreal, Ottawa). Le Service comm\u00e9moratif aura lieu le mardi 7 f\u00e9vrier 2017 \u00e0 10h30 en l'\u00e9glise Notre-Dame-de-Lourdes (435 chemin Montreal, Ottawa). La famille recevra les condol\u00e9ances \u00e0 l'\u00e9glise \u00e0 compter de 9h30. En m\u00e9moire de Anna, des dons \u00e0 la Fondation \u00c9lisabeth Bruy\u00e8re seraient grandement appr\u00e9ci\u00e9s.\n</p>\n<p>\nPassed away January 22, 2017 at the age of 84. She was the daughter of the late Th\u00e9ophile Saucier and the late Alma S\u00e9guin. She was the beloved wife of the late Cl\u00e9ment Labrecque. Anna was predeceased by her son Clement Jr. She leaves in sorrow her children; Fran\u00e7oise, Anne (Richard Paquin), Joanne (Antonio Raposo) and Lise; her grandchildren Jos\u00e9e, Roland, Eric, Patrick, Julie, Genevi\u00e8ve, V\u00e9ronique, Bruce and Pascale as well as her great-granchildren Claudia, Halle, Rowan, Tara, Thomas, Noah, No\u00e9mie and Chlo\u00e9. She leaves behind her sister Irma Beauchamp as well as many nephews, nieces and friends. Family and friends may pay their respects Monday February 6 2017 from 2 p.m. to 4 p.m. and from 6 p.m. to 8 p.m. at Racine, Robert &amp; Gauthier Funeral Home (180 Montreal Road, Ottawa). A Memorial Service will be held on Tuesday February 7 2017 at 10:30 a.m. at Notre-Dame-de-Lourdes Church (435 Montreal Road, Ottawa). The family will receive condolences at church from 9:30 a.m. In Memory of Anna, donations to the Elisabeth Bruy\u00e8re Foundation would be greatly appreciated.\n</p>\n</div>\n</div>",
