"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nnom prefixe: Capt.<br />\nCarlos Machado, p. 259.<br />\nCrist\u00f3v\u00e3o Afonso de Vasconcelos ou de Sousa Vasconcelos, capit\u00e3o e herdeiro do v\u00ednculo de sua cunhada Catarina de Figueiredo. Foi sargento da companhia da Bretanha, de que era capit\u00e3o o pai. (Vid. Fructuoso Liv.\u00d9B IV Cap.\u00d9B CX , e \u00d9G 13).Ainda vivia em 1606 e foi testamenteiro do pai (Nota N.\u00d9B 8). Casou na Bretanha a 8.10.1571 com Isabel Alvares, irm\u00e3 do padre vig\u00e1rio da Bretanha, Nicolau Domingos.<br />\n8) Crist\u00f3v\u00e3o Afonso de Vasconcelos ou de Sousa Vasconcelos (N.\u00d9B 4 \u00d9G 1.\u00d9B)<br />\nA 6.6.1606 em Ponta Delgada, Sim\u00e3o Dias, morador na Bretanha, faz procura\u00e7\u00e3o a v\u00e1rios, entre a seu sogro Crist\u00f3v\u00e3o Afonso [de Vasconcelos ou de Sousa Vasconcelos] (livro de notas de 1605 a 1606 do tabeli\u00e3o Jo\u00e3o de Povoas).\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nTermo dos Casados<br />\n08 (79) - 08.10.1571<br />\nCRIST\u00d3V\u00c3O AFONSO<br />\nE<br />\nISABEL \u00c1LVARES<br />\nIrm\u00e3 do Vig\u00e1rio Nicolau Domingos.<br />\nTestemunhas: Pedro Manuel e Rodrigo \u00c1lvares.<br />\nVig\u00e1rio Nicolau Domingos .\n</p>\n</div>\n</div>",
