"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nParentesco n\u00e3o provado.<br />\nTeixeira is a relatively uncommon name in Bretanha. Here is what comes from the Vicar\u2019s book:\n</p>\n<p>\nMarriages:\n</p>\n<p>\n02.01.1590<br />\nANT\u00d3NIO TEIXEIRA, son of  Francisco Pires Teixeira e de Cust\u00f3dia Fernandes, married<br />\nCATARINA DE FRIELAS (Her lineage goes back much further in Rodrigo Rodrigues:<br />\nCap.\u00ba 81.\u00ba \u00dbnici N\u00ba4)\n</p>\n<p>\n14.12.1620<br />\nANT\u00d3NIO TEIXEIRA married \u00c1GUEDA CALVA\n</p>\n<p>\n13.06.1621<br />\nMANUEL TEIXEIRA, son of Jo\u00e3o Gon\u00e7alves and Maria Teixeira, deceased, residents of S. Pedro da Ribeira Seca, married MARIA \u00c1LVARES, daughter of Francisco Fernandes and Maria \u00c1lvares,\n</p>\n<p>\nBaptisms:\n</p>\n<p>\n22.06.1608 - FRANCISCO, son of Manuel Teixeira e de Maria \u00c1lvares.\n</p>\n<p>\n17.04.1611 - ALEIXO, son of Jo\u00e3o Teixeira ande Maria \u00c1lvares.\n</p>\n<p>\n12.10.1613 - JER\u00d3NIMO, son of Francisco Teixeira and Maria \u00c1lvares\n</p>\n<p>\n22.02.1678 - TERESA, daughter of Ant\u00f3nio Teixeira and Maria \u00c1lvares<br />\nGodparents: Jo\u00e3o Teixeira and Maria Cabral, daughter of Francisco Afonso and \u00c1gueda (\u00c2ngela?) Cabral\n</p>\n<p>\n07.12.1679 - B\u00c1RBARA, daughter of Ant\u00f3nio Teixeira and Maria \u00c1lvares<br />\nGodparents: Manuel de Oliveira and Maria de Benevides, wife of Pedro de Sousa\n</p>\n<p>\nJohn Miranda Raposo\n</p>\n</div>\n</div>",
