"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMandou Construir uma Ermida nos Mosteiros ,Ermida de S\u00e3o L\u00e1zaro cerca de 1510.<br />\nParece que Afonso de Oliveira foi enterrado no Quintal de sua casa porque era Leproso e por lei nao se podia enterrar no cemiterio publico e no dito Quintal tem uma pedra com uma cruz.<br />\nfez a ermida de S. L\u00e1raro, nos Mosteiros e diz Frutuoso que era leproso (Vide Frutuoso, Livro IV, Cap.\u00d9B XVI)\n</p>\n</div>\n</div>",
