"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPadrinho na Bretanha: Giomar, filha de Jo\u00e3o Ferreira e Maria \u00c1lvares: 29-4-1606.<br />\nLourenco, filho de Francisco Cardoso and Iria Pais: 16-8-1606.<br />\nAmador de Vasconcelos, que casou com Beatriz Pessoa de Ara\u00fajo (Cap.\u00d9B 21.\u00d9B \u00d9G 1.\u00d9B N.\u00d9B 4) (Nota N.\u00d9B 9).\n</p>\n</div>\n</div>",
