"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n19.01.1613 - ANA, filha de Amador de Vasconcelos e de Beatriz Pessoa (?)<br />\nPadrinhos: Marcos Afonso de Sousa e Maria de Vasconcelos.<br />\nJos\u00e9 Fernandes. Baptizou o Padre Manuel Rodrigues, cura em Santo Ant\u00f3nio\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAna de Sousa Vasconcelos (do \u00d9G 1.\u00d9B), madrinha na Bretanha a 25.11.1618 onde aparece com o nome de Ana de Vasconcelos de Sousa, casou com o capit\u00e3o Pedro de Ara\u00fajo Pessoa ou Benevides, da Bretanha (Nota N.\u00d9B 18).<br />\n18) Ana de Sousa Vasconcelos (N.\u00d9B 5 \u00d9G 5.\u00d9B)<br />\nA 12.3.1614 em Ponta Delgada, nas pousadas de Pedro de Ara\u00fajo Pessoa, compareceu sua mulher Isabel Cabral e rectifica a venda que seu marido tinha feiro a Manuel Dias Ferreira de um foro (Liv.\u00d9B de Notas de 1613 a 1614 do tabeli\u00e3o Pedro Cabral). Ser\u00e1 que este Pedro de Ara\u00fajo Pessoa, que foi marido de Ana de Sousa Vasconcelos tenha casado com uma Isabel Cabral ?<br />\nDe um t\u00edtulo de arremata\u00e7\u00e3o a fls. 375 e seguintes do tombo do Convento da Esperan\u00e7a de Ponta Delgada consta que a 25.10.16323 em Ponta Delgada se requereu ao Juiz de Fora que fosse \u00e0 pra\u00e7a uma terra na Bretanha, que foi de Pedro de Ara\u00fajo Pessoa, falecido, da qual eram foreiros o lic.\u00d9B Jo\u00e3o Moreira, Agostinho Roiz, escriv\u00e3o das Execu\u00e7\u00f5es, Andr\u00e9 de Ara\u00fajo e Manuel Pacheco Pimentel, os quais corriam demanda sobre a prefer\u00eancia dessa terra; foram citados, depois de Agostinho Roiz oferecer o lan\u00e7o de 100 mil r\u00e9is, Pero da Fonseca (sic) e sua mulher (n\u00e3o diz o nome), moradores nos Mosteiros para esta arremata\u00e7\u00e3o da dita terra \u00d9S que foi de seu pai e sogro Pedro de Ara\u00fajo Pessoa \u00d9S, falecido, Jacinto Cabral, ausente desta Ilha, \u00d9S se queria lan\u00e7ar mais na terra que fora de seu pai \u00d9S, Sebasti\u00e3o de Pimentel, filho do morgado Manuel Pacheco Pimentel, Maria de Arruda da Costa, viuva de Manuel de Medeiros Ara\u00fajo, na pessoa de seu filho o morgado Manuel de Medeiros Ara\u00fajo e o licenciado Jo\u00e3o Moreira. Aparece Jo\u00e3o Fernandes Vult\u00e3o requerendo a medi\u00e7\u00e3o da terra que confronta com Gon\u00e7alo de Ara\u00fajo. S\u00f3 em 1639 foi a terra adjudicada ao maior lan\u00e7ador, Agostinho Roiz.\n</p>\n<p>\nAna de Sousa Vasconcelos (do \u00d9G 1.\u00d9B), madrinha na Bretanha a 25.11.1618 onde aparece com o nome de Ana de Vasconcelos de Sousa, casou com o capit\u00e3o Pedro de Ara\u00fajo Pessoa ou Benevides, da Bretanha (Nota N.\u00d9B 18).<br />\n18) Ana de Sousa Vasconcelos (N.\u00d9B 5 \u00d9G 5.\u00d9B)<br />\nA 12.3.1614 em Ponta Delgada, nas pousadas de Pedro de Ara\u00fajo Pessoa, compareceu sua mulher Isabel Cabral e rectifica a venda que seu marido tinha feiro a Manuel Dias Ferreira de um foro (Liv.\u00d9B de Notas de 1613 a 1614 do tabeli\u00e3o Pedro Cabral). Ser\u00e1 que este Pedro de Ara\u00fajo Pessoa, que foi marido de Ana de Sousa Vasconcelos tenha casado com uma Isabel Cabral ?<br />\nDe um t\u00edtulo de arremata\u00e7\u00e3o a fls. 375 e seguintes do tombo do Convento da Esperan\u00e7a de Ponta Delgada consta que a 25.10.16323 em Ponta Delgada se requereu ao Juiz de Fora que fosse \u00e0 pra\u00e7a uma terra na Bretanha, que foi de Pedro de Ara\u00fajo Pessoa, falecido, da qual eram foreiros o lic.\u00d9B Jo\u00e3o Moreira, Agostinho Roiz, escriv\u00e3o das Execu\u00e7\u00f5es, Andr\u00e9 de Ara\u00fajo e Manuel Pacheco Pimentel, os quais corriam demanda sobre a prefer\u00eancia dessa terra; foram citados, depois de Agostinho Roiz oferecer o lan\u00e7o de 100 mil r\u00e9is, Pero da Fonseca (sic) e sua mulher (n\u00e3o diz o nome), moradores nos Mosteiros para esta arremata\u00e7\u00e3o da dita terra \u00d9S que foi de seu pai e sogro Pedro de Ara\u00fajo Pessoa \u00d9S, falecido, Jacinto Cabral, ausente desta Ilha, \u00d9S se queria lan\u00e7ar mais na terra que fora de seu pai \u00d9S, Sebasti\u00e3o de Pimentel, filho do morgado Manuel Pacheco Pimentel, Maria de Arruda da Costa, viuva de Manuel de Medeiros Ara\u00fajo, na pessoa de seu filho o morgado Manuel de Medeiros Ara\u00fajo e o licenciado Jo\u00e3o Moreira. Aparece Jo\u00e3o Fernandes Vult\u00e3o requerendo a medi\u00e7\u00e3o da terra que confronta com Gon\u00e7alo de Ara\u00fajo. S\u00f3 em 1639 foi a terra adjudicada ao maior lan\u00e7ador, Agostinho Roiz.\n</p>\n</div>\n</div>",
