"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nManuel de Oliveira Vasconcelos, natural da Bretanha (Nota N.\u00d9B 1). Casou duas vezes: a primeira em S. Pedro Ribeira Grande a 30.12.1609 com B\u00e1rbara Cabral (Cap.\u00d9B 252.\u00d9B \u00d9G \u00danico, N.\u00d9B 3), a segunda em Santo Ant\u00f3nio a 8.7.1643 com sua parente em 4.\u00d9B grau Beatriz de Sousa (sic).<br />\n1) Manuel de Oliveira Vasconcelos (N.\u00d9B 2 \u00d9G 1.\u00d9B)<br />\nA 3.11.1654 autuou-se o invent\u00e1rio por morte de Manuel de Oliveira Vasconcelos, da Bretanha, sendo inventariante sua segunda mulher Beatriz de Sousa; dele consta a primeira mulher B\u00e1rbara Cabral e os filhos Manuel Cabral, casado, Sebasti\u00e3o de Oliveira de Vasconcelos, solteiro, de 28 anos, Ana de Oliveira de Vasconcelos, casada com Jo\u00e3o Ledo de Frias, de 26 anos, Maria de Oliveira, falecida, que foi casada com Gabriel Cardoso, de quem ficaram 4 filhos, que s\u00e3o: Ant\u00f3nio de 6 ou 7 anos, Manuel de 9 anos, Maria de 10 anos, e B\u00e1rbara de 5 anos. H\u00e1 ainda 3 filhos ausentes do inventariado que s\u00e3o Isabel de Sousa, casada em Santa Maria, Ant\u00f3nio Cabral ausente em Fontar\u00e1bia e Tom\u00e9 de Sousa no Rio de Janeiro.\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nIndividual, family 1, family 2: John Raposo\n</p>\n</div>\n</div>",
