"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nIndividual Note\n</p>\n<p>\nCarlos Machado, p. 531, she is called Maria, b. 16-11-1647 with no parents listed. In Oct\u00e1vio Reis's birth records, there is no child b. 16-11-1647. There is an Ana, b. 17-11-1647, daughter of Antonio de Vasconcelos and Agueda....There are several children born to Ant\u00f3nio de Vasconcelos and \u00c1gueda de Ara\u00fajo (1641, 45, 1650, 56, 58, 1660, 63, 66). Antonio, b. 10-Aug-1621, is the son of Amador Vasconcelos and Beatriz Pessoa Ara\u00fajo (CM, p. 259).\n</p>\n</div>\n</div>",
