"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFern\u00e3o Velho wasa Knight in the Order of Santiago,Alcaide-mor and Lord Valeda,Lord of Soutoda Mer\u00ea.He was raised in the Parish of Santa Maria de Quint\u00e3es, Aguiar de Neiva\n</p>\n</div>\n</div>",
