"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLegitimized in 1299 and raised in Parish of S\u00e3o Martinho de Balug\u00e3es,Aguiar de Neiva- ANTT. Chancelaria de D. Dinis L\u00ba 3,fl. 7v\u00ba. a vassal of King Dinis.<br />\nF\u00ba.B\u00ba. de Jo\u00e3o Pires; legitimado por D.Dinis em 1299.<br />\nCasou c/ Margarida Anes de Urr\u00f4, de quem teve Fern\u00e3o Gon\u00e7alves Velho (Alcaide do Castelo de Veleda em 1370), pai de Gon\u00e7alo Velho Cabral, \"descobridor\" dos A\u00e7ores.\n</p>\n<p>\nLMP-Vol.1-pg.349/50.<br />\nNGEDM-Vol.I-pg.398.\n</p>\n</div>\n</div>",
