"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\nApesar de B\u00ba, \"acabou por surgir como a figura mais relevante da linhagem dos 'Velho' durante o per\u00edodo dionisino\"(Pizarro).<br />\nVassalo da Casa do Infante D.Dinis (1278).<br />\nDo Conselho R\u00e9gio e Embaixador \u00e0 Corte de Arag\u00e3o (1281 - D.Dinis), para tratar do casamento Real.<br />\nPoeta e Trovador.\n</p>\n<p>\nLMP-Vol.1-pg.345/8.<br />\nNGEDM-Vol.I-pg.398.<br />\ngeneall.net/P (115048).\n</p>\n</div>\n</div>",
