"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\nIsaura V. Medeiros\n</p>\n<p>\n( November 07, 2015 )<br />\nIsaura (Viveiros) Medeiros, age 85, of Fall River, passed away Saturday, November 7, 2015, at the Charlton Memorial Hospital in Fall River, following an illness. She was the widow of Joao T. Medeiros. Born in Ajuda da Bretanha, on the island of Sao Miguel in the Azores, she was a daughter of the late Augusto Alves Viveiros and the late Maria Tavares (Ferreira) Viveiros. After residing in the Azores for seventeen years, she immigrated to Fall River in 1947 and became a naturalized citizen of the United States of America. Residing in Fall River for most of her life, she was a trimmer, employed in the garment trade of this city for many years at the former Shelburne Shirt Co. Isaura was a communicant of Espirito Santo Church in Fall River and was a member of the International Ladies Garment Workers Union. Surviving family members include her three daughters; Imaculada Medeiros-Martin (husband Paulo), Olivia Necchi (fianc\u00e9 Dennis Viveiros) and Lucy Da Cunha (husband Jose), all of Somerset, a brother, Camilo Viveiros (wife Maria) of Somerset, two sisters; Josefina Barreira (husband Dinis) of Fall River and Olivia Camara (husband Manuel Antonio) of South Dartmouth, MA, six grandchildren; Melissa Necchi-Joynt, Paul Necchi, Joseph Da Cunha, Zachary Da Cunha, Jocelyn (Martin) Eseltine and Jordan Martin, three great grandchildren; Victoria Da Cunha, Isabella Necchi and Collin Joynt, and many nieces and nephews. She was also the sister of the late Maria V. Pacheco. Her Funeral Mass was celebrated on Thursday, November 12th, in Espirito Santo Church followed by her committal at Notre Dame Cemetery.\n</p>\n</div>\n</div>",
