"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSilvana R. (Viveiros) Carvalho, 86 of Fall River and formerly of Punta Gorda, FL. Born in Bretanha, Sao Miguel, Acores, she was the widow of Joao P. Carvalho and the daughter of the late Antonio &amp; Rosa (Oliveira) Viveiros. Prior to retiring, Silvana worked as a machine operator for Merit Dress Co., and she was a parishioner of St. Michael\u2019s Church.\n</p>\n<p>\nShe is survived by her 2 sons: Joao P. Carvalho (wife Lydia) of Fall River and Louis P. Carvalho Jr. (wife Debra) of Winter Springs, FL; grandchildren: Cindy Arruda (husband Messias), Dereck Carvalho, Keith Carvalho (wife Kristen), Kenny Carvalho (wife Alyssa); great grandchildren: Evan &amp; Emma Arruda, Hailey Carvalho, and the late Shane Carvalho; siblings: Jose Viveiros of Swansea, &amp; Gilda Viveiros of Fall River; many nieces &amp; nephews. She was the sister of the late Antone &amp; Manuel Viveiros, Sophia Benjamin, &amp; Maria Viveiros\n</p>\n</div>\n</div>",
